import React, {useState} from "react"
import 'lo';

export const  Register = (props) => {
    const[email, setEmail]  = useState('')
    const [number, setNumber] = useState('')

    const handleSubmit = (e) => {
        e.preventDefault();
            console.log(email);
    }
    
    return (
         <div className="auth-form-container">
             <form onSubmit={handleSubmit}>
           <label htmlFor="email">Email</label>
		   <input value={email} onChange={(e) => setEmail(e.target.value)}  type="email" placeholder="youremail" id="email" name="email"></input>
		   <label for="number">Number</label>
		   <input value={number} onChange={(e) => setNumber(e.target.value)}  type="tel" placeholder="number" id="number" name="number"></input>
		   <button type="submit">Send</button>
		 </form>
		<button onClick={() =>  props.onFormSwitch("loginForm")}>Already have an account? Register</button>
         </div>
    )
}
export default Register;
